import { Container, Paper, Stack, Tab, Tabs, Typography } from '@mui/material';
import React from 'react'

import {
    Route,
    Routes
} from "react-router-dom";

import ProfileImage from '../Assests/profile.png'
import { styled } from '@mui/material/styles';

import Cover from '../Assests/cover.avif';

import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell, { tableCellClasses } from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import { Assest, CustomLink } from '../Components/Components';

import Sample from '../Assests/AssestPhotoSample.jpg'

const ProfilePhotoWrap = styled('img')(() => ({
    width: 150,
    height: 150,
    borderRadius: '100%',
    overflow: 'hidden',
    marginRight: 20,
    borderWidth: 7,
    borderColor: '#FFF',
    borderStyle: 'solid'
}))

const CustomizedPaper = styled(Paper)(({ theme }) => ({
    borderRadius: 15,
    height: 300,
    overflow: 'hidden',
    display: 'flex',
    alignItems: 'center',
    [theme.breakpoints.down('sm')]: {
        display: 'none'
    }
}))

const DetailsContainer = styled(Container)(({ theme }) => ({
    marginTop: -60,
    width: 'fit-content',
    [theme.breakpoints.down('sm')]: {
        marginTop: 50
    }
}))

function samePageLinkNavigation(event) {
    if (
        event.defaultPrevented ||
        event.button !== 0 || // ignore everything but left-click
        event.metaKey ||
        event.ctrlKey ||
        event.altKey ||
        event.shiftKey
    ) {
        return false;
    }
    return true;
}


function LinkTab(props) {
    return (
        <Tab
            component="a"
            // onClick={(event) => {
            //     // Routing libraries handle this, you can remove the onClick handle when using them.
            //     if (samePageLinkNavigation(event)) {
            //         event.preventDefault();
            //     }
            // }}
            {...props}
        />
    );
}


export default function Profile() {
    const [value, setValue] = React.useState(0);

    const handleChange = (event, newValue) => {
        // event.type can be equal to focus with selectionFollowsFocus.
        if (
            event.type !== 'click' ||
            (event.type === 'click' && samePageLinkNavigation(event))
        ) {
            setValue(newValue);
        }
    };
    return (
        <Container fixed>
            <CustomizedPaper elevation="24">
                <img src={Cover} width='100%' alt='Cover photo' />
            </CustomizedPaper>
            <Container sx={{
                display: 'flex',
                justifyContent: 'center',
                width: '100%'
            }} fixed >
                <DetailsContainer>
                    <ProfilePhotoWrap src={ProfileImage} alt='Prifile picture' />
                    <Typography fontWeight={700} variant='h4'>Username</Typography>
                    <Typography fontWeight={500} variant='body1'>#WalletNumber</Typography>
                </DetailsContainer>
            </Container>
            <Container>
                <Stack flexWrap="wrap" direction="row" mb="10px">
                    <Tabs value={value} onChange={handleChange} aria-label="nav tabs example">
                        <LinkTab label="Wallet" href="/profile" />
                        <LinkTab label="Collection" href="/profile/feed" />
                        <LinkTab label="Activity" href="/profile/activity" />
                    </Tabs>
                </Stack>
            </Container>
            <Routes>
                <Route index element={<Wallet />} />
                <Route exact path='/activity' element={<Activity />} />
                <Route exact path='/feed' element={<Feed />} />
            </Routes>
        </Container >
    )
}

const StyledTableCell = styled(TableCell)(({ theme }) => ({
    [`&.${tableCellClasses.head}`]: {
        backgroundColor: "#1a237e",
        color: theme.palette.common.white,
    },
    [`&.${tableCellClasses.body}`]: {
        fontSize: 14,
    },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
    '&:nth-of-type(odd)': {
        backgroundColor: theme.palette.action.hover,
    },
    // hide last border
    '&:last-child td, &:last-child th': {
        border: 0,
    },
}));

function createData(name, calories, fat, carbs, protein) {
    return { name, calories, fat, carbs, protein };
}

const rows = [
    createData('Heroes of Parallel', 159, 6.0, 24, 4.0),
    createData('Winesed Elder', 237, 9.0, 37, 4.3),
    createData('Heroes of Parallel', 262, 16.0, 24, 6.0),
    createData('Test NFT ', 305, 3.7, 67, 4.3),
    createData('Heroes of Parallel', 356, 16.0, 49, 3.9),
];

export function Activity() {
    return (
        <div>
            {/* <ProfileContent/> */}
            <TableContainer sx={{ marginTop: 10, borderRadius: 3 }} component={Paper}>
                <Table sx={{ minWidth: 700 }} aria-label="customized table" >
                    <TableHead>
                        <TableRow>
                            <StyledTableCell>Item</StyledTableCell>
                            <StyledTableCell align="right">Price&nbsp;(ETH)</StyledTableCell>
                            <StyledTableCell align="right">Qty</StyledTableCell>
                            <StyledTableCell align="right">From</StyledTableCell>
                            <StyledTableCell align="right">To</StyledTableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {rows.map((row) => (
                            <StyledTableRow key={row.name}>
                                <StyledTableCell component="th" scope="row">
                                    {row.name}
                                </StyledTableCell>
                                <StyledTableCell align="right">{row.calories}</StyledTableCell>
                                <StyledTableCell align="right">{row.fat}</StyledTableCell>
                                <StyledTableCell align="right">{row.carbs}</StyledTableCell>
                                <StyledTableCell align="right">{row.protein}</StyledTableCell>
                            </StyledTableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>
        </div>
    )
}

export function Feed() {
    return (
        <div>
            <CustomLink element={<Assest src={Sample} name="Art" price="0.0001ETH" />} to="/artsample" />
        </div>
    )
}

export function Wallet() {
    return(
        <h1>Wallet</h1>
    )
}
